import unittestfrom titanic_notebook_refactoring_starter import prepare_data_and_train_modelclass TestFunctional(unittest.TestCase):    def test_prepare_data_and_train_model_should_return_accuracy_scores(self):        # Arrange        expected = 0.5        # Act        scores = prepare_data_and_train_model()        # Assert        for current_score in scores:            self.assertGreater(current_score, expected)